import { initState } from '../initState';


export const logoutReducer = (state = initState, action) =>
{
const { type, payload } = action;
console.log(payload);
  switch (type) {
    case 'LOGOUT':
      return { 
        name: undefined, 
        role: undefined, 
        error: undefined,
      };
    default:
      return state;
  }
}
